import React from 'react'



export default function InsideModifier({title,list}) {


  const PresetList=['Random','Coin','Sound3','Sound4','Sound5','Sound6']
  const FuncList=['unoise','sine','saw','traingle','square','synth','noise','string']
  
  let soundButton;
  if(title === 'Presets'){
    soundButton = PresetList.map((preset,index)=>(
      <button key={index} style={{width:81,margin:3}}>{preset}</button>
    ));
  }

  let chunks = [];
  for (let i = 0; i < FuncList.length; i += 2) {
    chunks.push(FuncList.slice(i, i + 2));
  }

  let FuncItem = chunks.map((chunk, rowIndex) => (
    <tr key={rowIndex}>
      {chunk.map((item, colIndex) => (
        <td key={colIndex}>
            <input type='radio'/>
            <label>{item}
            </label>
            </td>
      ))}
    </tr>
  ));


  let listitem = list.map((item,index)=>{
    if(item==="Func"){
      return(
        <tr>
        <td key={index}>{item}</td>
        <td style={{textAlign:'right'}}>
        <form id="Generator$Func">
          <span class="radio-option">
          <input type="radio" id="Generator_Func_unoise" name="Generator_Func" value="unoise"/>
          <label for="Generator_Func_unoise">unoise</label>
          </span>
          <span class="radio-option">
            <input type="radio" id="Generator_Func_sine" name="Generator_Func" value="sine"/>
            <label for="Generator_Func_sine">sine</label>
            </span>
            <span class="radio-option">
            <input type="radio" id="Generator_Func_saw" name="Generator_Func" value="saw"/>
            <label for="Generator_Func_saw">saw</label>
            </span>
            <span class="radio-option">
              <input type="radio" id="Generator_Func_triangle" name="Generator_Func" value="triangle"/>
              <label for="Generator_Func_triangle">triangle</label>
              </span>
              <span class="radio-option">
                <input type="radio" id="Generator_Func_square" name="Generator_Func" value="square"/>
                <label for="Generator_Func_square">square</label>
                </span>
                <span class="radio-option">
                  <input type="radio" id="Generator_Func_synth" name="Generator_Func" value="synth"/>
                  <label for="Generator_Func_synth">synth</label>
                  </span>
                  <span class="radio-option"/>
                  <input type="radio" id="Generator_Func_noise" name="Generator_Func" value="noise"/>
                  <label for="Generator_Func_noise">noise</label>
                  <span/><span class="radio-option"><input type="radio" id="Generator_Func_string" name="Generator_Func" value="string"/><label for="Generator_Func_string">string</label></span></form>
          </td>
        </tr>
      );
    }
    else{
      return(
      <tr>
        <td key={index}>{item}</td>
        <td style={{textAlign:'right'}}><input type='range' min={0} max={1} step={0.01} style={{width:170}}></input></td>
      </tr>
      );
    }
})

  return (
    <div className='insideModifier'>
      <div style={{paddingLeft:6,paddingRight:6}}><b>{title}</b></div>
      <div>
        <table id='tablewidth'>
          {listitem}
        </table>
      </div>
      <div className='rangeInput'>
        {soundButton}
      </div>
    </div>
  )
}
